import ChatBoxReceiver, { ChatBoxSender } from "./components/ChatBox";
import InputText from "./components/InputText";

function App() {
  return (
    <div style={{backgroundColor: "#ece5dd", height:"100vh"}}>
      <h1>Algebra Chat App</h1>
      <ChatBoxReceiver user="Mario" avatar="https://picsum.photos/200/300" message="Hello there"/>
      <ChatBoxSender user="Algebra User" avatar="https://picsum.photos/id/237/200/300" message="Hi to you as well!"/>
      <InputText addMessage={(message)=>console.log(message.message)}/>
    </div>
  );
}

export default App;
